삼각형 $ABC$는 이등변 삼각형이며, $AB=AC$이고 높이 $AM=11$입니다. $\overline{AM}$ 위에 점 $D$가 있고 $AD=10$이며 $\angle BDC=3\angle BAC$일 때, 삼각형 $ABC$의 둘레를 구하세요.

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

